import Formulario from './componentes/Formulario';
import ResultadoDivisao from './componentes/ResultadoDivisao';


function App() {
  return (
    <div className="App">
      <Banner  />
      <Formulario />
      <ResultadoDivisao resultado={30} x={2} y={6}/>
    </div>
  );
}

export default App;
